webpackJsonp([0xa41d27122fe5],{529:function(e,t){e.exports={data:{wordpressWpLessons:{id:"e0217341-3182-5b98-b902-7c2c65d01470",wordpress_id:1121,title:"Gimp: Saving Your Work",slug:"gimp-saving-your-work",content:'<h2><strong><span style="color: #0091c9;">ACTIVITY: Save Your Design</span></strong></h2>\n<p>You&#8217;ll need to save your design two ways before you upload the saved files to Google Drive. First, you&#8217;ll save a <strong>.XCF</strong> file. This is your working file. If you need to make changes to your design, you can with this type of file. To save your design as a .XCF file, click File &gt; Save As and then change your title and save to your Desktop.</p>\n<p><a href="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save1.png"><img class="alignnone size-full wp-image-7471" src="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save1.png" alt="gimp saving your work xcf" width="602" height="866" srcset="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save1.png 602w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save1-209x300.png 209w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save1-70x100.png 70w" sizes="(max-width: 602px) 100vw, 602px" /></a></p>\n<p><a href="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save2.png"><img class="alignnone size-large wp-image-7472" src="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save2-1024x801.png" alt="gimp saving your work xcf" width="625" height="489" srcset="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save2-1024x801.png 1024w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save2-300x235.png 300w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save2-768x600.png 768w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save2-128x100.png 128w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save2-624x488.png 624w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save2-100x78.png 100w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save2-750x586.png 750w" sizes="(max-width: 625px) 100vw, 625px" /></a></p>\n<p>To be able to upload your design to Scratch or any other website you need to export your design as a <strong>.png</strong> or <strong>.jpg</strong> file. PNG stands for Portable Network Graphics, it is a file type that is used widely on the internet and in other mediums because the file size is small and easy to handle.</p>\n<p><a href="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save3.png"><img class="alignnone size-full wp-image-7474" src="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save3.png" alt="gimp saving your work png file" width="596" height="870" srcset="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save3.png 596w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save3-206x300.png 206w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save3-69x100.png 69w" sizes="(max-width: 596px) 100vw, 596px" /></a></p>\n<p><a href="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save4.png"><img class="alignnone size-large wp-image-7475" src="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save4-1024x510.png" alt="gimp saving your work png file" width="625" height="311" srcset="http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save4-1024x510.png 1024w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save4-300x150.png 300w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save4-768x383.png 768w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save4-200x100.png 200w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save4-624x311.png 624w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save4-100x50.png 100w, http://learn.digitalharbor.org/wp-content/uploads/2016/02/gimp-save4-750x374.png 750w" sizes="(max-width: 625px) 100vw, 625px" /></a></p>\n<h2><strong><span style="color: #0091c9;">ACTIVITY: Upload Your File to Google Drive</span></strong></h2>\n<ol>\n<li style="list-style-type: none;">\n<ol>\n<li><strong>Tip</strong>: When you upload files to your drive, you don&#8217;t need to worry about which computer you&#8217;re using while at the Tech Center. You can even work on your designs at home!</li>\n<li><strong><span style="text-decoration: underline;">Sign in</span></strong> to your Google account/email address. Find and click the <em>Apps</em> icon.</li>\n</ol>\n</li>\n</ol>\n<p><a href="http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google.jpg"><img class="alignnone wp-image-185" src="http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google-300x191.jpg" alt="Google" width="324" height="206" srcset="http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google-300x191.jpg 300w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google-1024x652.jpg 1024w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google-157x100.jpg 157w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google.jpg 1153w" sizes="(max-width: 324px) 100vw, 324px" /></a></p>\n<ol>\n<li style="list-style-type: none;">\n<ol>\n<li>Select <span style="text-decoration: underline;"><strong>Drive</strong></span><em> </em>from the <em>Apps</em> pop-up menu. Note that this is a good shortcut for accessing many other features such as Mail, Calendar, and creating files in the Drive.</li>\n</ol>\n</li>\n</ol>\n<p><a href="http://learn.digitalharbor.org/wp-content/uploads/2015/02/New-Tab.jpg"><img class="alignnone wp-image-187" src="http://learn.digitalharbor.org/wp-content/uploads/2015/02/New-Tab-245x300.jpg" alt="New Tab" width="245" height="300" srcset="http://learn.digitalharbor.org/wp-content/uploads/2015/02/New-Tab-245x300.jpg 245w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/New-Tab-82x100.jpg 82w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/New-Tab.jpg 351w" sizes="(max-width: 245px) 100vw, 245px" /></a></p>\n<ol>\n<li style="list-style-type: none;">\n<ol>\n<li>Once you open the Drive, click <span style="text-decoration: underline;"><strong>New</strong></span><em> </em>on the left menu. If you don&#8217;t see <span style="text-decoration: underline;"><strong>New</strong></span>, click the gears icon in the top right, and then click <span style="text-decoration: underline;"><strong>Experience the New Drive</strong></span>.</li>\n</ol>\n</li>\n</ol>\n<p><a href="http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-new.jpg"><img class="alignnone size-medium wp-image-189" src="http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-new-300x188.jpg" alt="My Drive - Google Drive (new)" width="300" height="188" srcset="http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-new-300x188.jpg 300w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-new-1024x642.jpg 1024w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-new-160x100.jpg 160w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-new.jpg 1299w" sizes="(max-width: 300px) 100vw, 300px" /></a><a href="http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google-Drive.jpg"><img class="alignnone size-full wp-image-188" src="http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google-Drive.jpg" alt="Google Drive" width="197" height="114" srcset="http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google-Drive.jpg 197w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/Google-Drive-173x100.jpg 173w" sizes="(max-width: 197px) 100vw, 197px" /></a></p>\n<ol>\n<li style="list-style-type: none;">\n<ol>\n<li><strong>Upload Options</strong>:\n<ul>\n<li><em>Option 1- File</em>: Uploads a single file. You&#8217;ll be prompted to select the file in the browser. <span style="text-decoration: underline;"><strong>Navigate</strong></span> to where you saved your design file.</li>\n<li><em>Option 2- Folder</em>: Uploads an entire folder. This is useful if you have multiple designs stored in one location.</li>\n</ul>\n</li>\n</ol>\n</li>\n</ol>\n<p><a href="http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-1.jpg"><img class="alignnone size-medium wp-image-190" src="http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-1-238x300.jpg" alt="My Drive - Google Drive-1" width="238" height="300" srcset="http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-1-238x300.jpg 238w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-1-79x100.jpg 79w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-1.jpg 252w" sizes="(max-width: 238px) 100vw, 238px" /></a> <a href="http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive.jpg"><img class="alignnone size-medium wp-image-191" src="http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-244x300.jpg" alt="My Drive - Google Drive" width="244" height="300" srcset="http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-244x300.jpg 244w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive-81x100.jpg 81w, http://learn.digitalharbor.org/wp-content/uploads/2015/02/My-Drive-Google-Drive.jpg 260w" sizes="(max-width: 244px) 100vw, 244px" /></a></p>\n<ol>\n<li style="list-style-type: none;">\n<ul>\n<li><strong>Note</strong>: File is faster and more reliable. If you have difficulties with the folder option, you can always upload each file one at a time.</li>\n</ul>\n</li>\n<li>Once you&#8217;ve selected your file, click <span style="text-decoration: underline;"><strong>Open</strong></span><em> </em>to save the file to your drive!</li>\n</ol>\n<ul>\n<li><strong>Best Practices</strong>: Upload your content at the end of every Maker Foundations session! <em>Leave roughly 5 minutes to do this</em>.</li>\n</ul>\n<h2>Gimp Tips &amp; Tricks</h2>\n<ul>\n<li>Remember to save early and save often!</li>\n<li>Use control-D to duplicate objects.</li>\n<li>Here is a list of hotkeys for Gimp: <a href="http://www.gimpusers.com/gimp/hotkeys">Gimp Hotkeys</a></li>\n<li>Don&#8217;t forget that you can Undo any changes or accidental deletes by using <b>&#8220;Undo&#8221;</b>.</li>\n</ul>\n'}},pathContext:{}}}});
